import React from 'react';
import { Route, Link } from 'react-router-dom';

import MainPage from './component/MainPage';
import MessagesPage from './component/MessagesPage';
import Footer from './component/NavBar/Footer'

import Acceuil from './component/Page/Acceuil';
import Contact from './component/Page/Contact';
import Friends from './component/Page/Friends';
import Home from './component/Page/Home';
import Profil from './component/Page/Profil';

import Logout from './component/register/Logout';
import SignIn from './component/register/SignIn';
import SignUp from './component/register/SignUp';


export default class NavigationPanel extends React.Component {
	render() {
		return <nav id="navPanel">
			<Route exact path='/' component={Acceuil}/>
			<Route exact path='/Home' component={Home}/>
			<Route exact path='/SignIn' component={SignIn}/>
			<Route exact path='/SignUp' component={SignUp}/>
			<Route exact path='/Logout' component={Logout}/>
			<Route exact path='/Contact' component={Contact}/>
			<Route exact path='/Messages' component={MessagesPage}/>
			<Route exact path='/Profil' component={Profil}/>
			<Route exact path='/Friends' component={Friends}/>
			<Footer/>
		</nav>;
	}
}
